const styles = StyleSheet.create({
    card:{
        marginTop: 20,
        borderColor: '#939393',
        borderRadius: 5,
        borderWidth: 1,
        padding: 10,
        backgroundColor: '#FFF',
        width: '90%'

    },
    cardContent:{
        marginTop: 10,
    },
    cardHeader:{
        fontWeight: 'bold'
    }

})

export default styles
